import React, { Component } from 'react'
import { Card, Descriptions } from 'antd';
import { EditOutlined, EllipsisOutlined, SettingOutlined } from '@ant-design/icons';
import './index.css'

const { Meta } = Card;

export default class CommodityCard extends Component {

    render() {
        return (
            <Card
                style={{ width: 300 }}
                cover={
                    <img
                        alt="example"
                        src="https://gw.alipayobjects.com/zos/rmsportal/JiqGstEfoWAOHiTxclqi.png"
                    />
                }
                actions={[
                    <SettingOutlined key="setting" />,
                    <EditOutlined key="edit" />,
                    <EllipsisOutlined key="ellipsis" />,
                ]}
                // loading={true}
            >
                <Descriptions size="small" style={{padding:0}}>
                    <Descriptions.Item label="Telephone" span={2}>1810000000</Descriptions.Item>
                    <Descriptions.Item label="UserName"  span={2}>12</Descriptions.Item>
                </Descriptions>

            </Card>
        )
    }
}
